// Sample Plant Data
const plants = [
    { id: 1, name: 'Monstera', price: 22.00, category: 'Indoor', image: 'https://images.unsplash.com/photo-1614594975525-e45190c55d0b?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1974&q=80' },
    { id: 2, name: 'Snake Plant', price: 18.00, category: 'Indoor', image: 'https://encrypted-tbn2.gstatic.com/shopping?q=tbn:ANd9GcTEJ0gU_SFshZgM-5cPoLXl89aoU88PUQYEMfFmCbgqlWxQ_2k-arRJp68T5ZTu0gseOTAeXzeCmwhNHOBVrRgQDtm6q4vjJtBEfnhfD_olVEegDtP9KKGI' },
    { id: 3, name: 'Cactus', price: 15.00, category: 'Succulent', image: 'data:image/webp;base64,' },
    { id: 4, name: 'Fiddle Leaf Fig', price: 30.00, category: 'Indoor', image: 'data:image/webp;base64,' },
    { id: 5, name: 'Aloe Vera', price: 12.00, category: 'Succulent', image: 'https://www.ikea.com/us/en/images/products/aloe-vera-potted-plant-aloe__1368841_pe957973_s5.jpg?f=s' },
    { id: 6, name: 'Lavender', price: 20.00, category: 'Outdoor', image: 'data:image/jpeg;base64,' },
    { id: 7, name: 'Rosemary', price: 16.00, category: 'Outdoor', image: 'data:image/jpeg;base64,' }
];

let cart = [];

// DOM Elements
const landingSection = document.getElementById('landing');
const productsSection = document.getElementById('products');
const cartSection = document.getElementById('cart');
const getStartedButton = document.getElementById('get-started');
const cartIcon = document.getElementById('cart-icon');
const cartCountSpan = document.getElementById('cart-count');
const cartItemsDiv = document.getElementById('cart-items');
const cartTotalDiv = document.getElementById('cart-total');
const continueShoppingButton = document.getElementById('continue-shopping');
const checkoutButton = document.getElementById('checkout');
const modal = document.getElementById('modal');

// Functions
function displayProducts() {
    productsSection.style.display = 'grid';
    landingSection.style.display = 'none';
    cartSection.style.display = 'none';

    productsSection.innerHTML = ''; // Clear existing products

    plants.forEach(plant => {
        const productDiv = document.createElement('div');
        productDiv.classList.add('product');

        productDiv.innerHTML = `
            <img src="${plant.image}" alt="${plant.name}">
            <h3>${plant.name}</h3>
            <p>$${plant.price.toFixed(2)}</p>
            <button class="add-to-cart" data-id="${plant.id}">Add to Cart</button>
        `;

        productsSection.appendChild(productDiv);
    });

    // Add event listeners to the "Add to Cart" buttons
    const addToCartButtons = document.querySelectorAll('.add-to-cart');
    addToCartButtons.forEach(button => {
        button.addEventListener('click', addToCart);
    });
}

function addToCart(event) {
    const plantId = parseInt(event.target.dataset.id);
    const plant = plants.find(plant => plant.id === plantId);

    if (plant) {
        const existingCartItem = cart.find(item => item.id === plantId);

        if (existingCartItem) {
            existingCartItem.quantity++;
        } else {
            cart.push({
                id: plant.id,
                name: plant.name,
                price: plant.price,
                image: plant.image,
                quantity: 1
            });
        }

        updateCartDisplay();
    }
}

function updateCartDisplay() {
    let total = 0;
    cartItemsDiv.innerHTML = ''; // Clear existing cart items

    cart.forEach(item => {
        const cartItemDiv = document.createElement('div');
        cartItemDiv.classList.add('cart-item');

        cartItemDiv.innerHTML = `
            <img src="${item.image}" alt="${item.name}" style="width: 50px;">
            <span>${item.name} (${item.quantity})</span>
            <span>$${(item.price * item.quantity).toFixed(2)}</span>
        `;

        total += item.price * item.quantity;
        cartItemsDiv.appendChild(cartItemDiv);
    });

    cartTotalDiv.textContent = `Total: $${total.toFixed(2)}`;
    cartCountSpan.textContent = cart.length;
}

function displayCart() {
    productsSection.style.display = 'none';
    landingSection.style.display = 'none';
    cartSection.style.display = 'block';
    updateCartDisplay();
}

function displayLanding() {
    productsSection.style.display = 'none';
    landingSection.style.display = 'block';
    cartSection.style.display = 'none';
}

function displayModal(message) {
    modal.style.display = 'flex';
    document.getElementById('modal-content').textContent = message;

    setTimeout(() => {
        modal.style.display = 'none';
    }, 2000);
}

// Event Listeners
getStartedButton.addEventListener('click', displayProducts);
cartIcon.addEventListener('click', displayCart);
continueShoppingButton.addEventListener('click', displayProducts);
checkoutButton.addEventListener('click', () => displayModal('Checkout coming soon!'));

// Initialize
displayLanding();
